INSERT INTO `playas` (`idPlaya`, `idMun`, `nombre`, `descripcion`, `direccion`, `playaSize`, `longitud`, `latitud`, `imagen`) VALUES
(1173, 2, 'Playa de La Arena', 'Playa que se extiende de forma longitudinal 800 metros aproximadamente. Tiene arena negra fina que alterna en algunas zonas con grava o callaos de granulometría pequeña. Presenta un pequeño charco artificial realizado con piedras de la zona en su parte septentrional.  Otros: La zona más septentrional a diferencia del resto, tiene papeleras, cartel de prohibido perros, bandera de señalización y flotadores de salvamento. Está próxima a aparcamientos y zonas comerciales de ocio y restauración. ', 'Avenida de la Constitución', '800 metros', 28.3539, -16.3697, );
INSERT INTO `playas` (`idPlaya`, `idMun`, `nombre`, `descripcion`, `direccion`, `playaSize`, `longitud`, `latitud`, `imagen`) VALUES
(1174, 2, 'Playa de El Alcalde', 'Descripción: Pequeña playa en forma de herradura, con escolleras en ambos extremos. La parte superior es de tierra, en la zona media presenta callaos de granulometría pequeña y, en la parte inferior, arena. Su longitud está en torno a los 30 metros. Cuenta con jardines en la parte superior. Dispone de papeleras. Está próxima a aparcamientos y a zonas comerciales, de ocio y restauración.  ', 'Avda. de la Constitución', '30 metros', 28.3559, -16.3695, );
INSERT INTO `playas` (`idPlaya`, `idMun`, `nombre`, `descripcion`, `direccion`, `playaSize`, `longitud`, `latitud`, `imagen`) VALUES
(1175, 2, 'Playa El Pozo', 'Descripción: Playa de callaos de granulometría pequeña. De unos 12 metros de longitud, se encuentra inserta en el refugio pesquero.  Otros: Próxima a un puesto de salvamento marítimo de la Cruz Roja. Hay contenedores, un cartel de prohibidos perros y barcos varados. Existe una hornacina para la Virgen del Carmen. Se encuentra próxima a zonas de ocio y restauración. ', 'Avda. la Constitución', '12 metros', 28.3576, -16.3688, );
INSERT INTO `playas` (`idPlaya`, `idMun`, `nombre`, `descripcion`, `direccion`, `playaSize`, `longitud`, `latitud`, `imagen`) VALUES
(1176, 2, 'Playa La Hornilla', 'Descripción: Pequeño paseo marítimo con zonas aptas para el baño. Cuando hay bajamar aparece una pequeña playa de fina arena negra en la parte superior. Cuenta con varios puntos de acceso al agua.  Otros: Dispone de papeleras y contenedores de basura, así como de zonas ajardinadas ', 'C/ La PIscina, Candelaria', 'Desconocido', 28.3601, -16.3669, );
INSERT INTO `playas` (`idPlaya`, `idMun`, `nombre`, `descripcion`, `direccion`, `playaSize`, `longitud`, `latitud`, `imagen`) VALUES
(1177, 2, 'Playa de Punta Larga', 'La nueva zona de baño de Punta Larga tiene rampas de entrada y una pasarela de madera que discurre en paralelo al paseo marítimo.', 'Avda. Marítima, Punta Larga', 'Desconocido', 28.3684, -16.3621, );
INSERT INTO `playas` (`idPlaya`, `idMun`, `nombre`, `descripcion`, `direccion`, `playaSize`, `longitud`, `latitud`, `imagen`) VALUES
(1178, 3, 'Playa la Arena', 'Playa natural de arena negra volcánica, situada en la costa de Puerto Santiago, ha sido galardonada consecutivamente con la bandera azul de los mares limpios de Europa desde 1988 hasta hoy, por la calidad de sus aguas, , accessibilidad y servicios que ofrece al bañista.', 'Av marítima, playa la arena', '178 m', 0, 0, );
INSERT INTO `playas` (`idPlaya`, `idMun`, `nombre`, `descripcion`, `direccion`, `playaSize`, `longitud`, `latitud`, `imagen`) VALUES
(1179, 3, 'Playa de los Guios o Argel', 'Playa junto al acantilado y al muelle de los Gigantes.', 'C/ los Guios, los Gigantes', '140 m', 0, 0, ),
(1180, 4, 'Playa del Camisón', ' Ubicada en una de las zonas más transitadas de Playa de Las Américas, la Playa del Camisón brinda a sus bañistas sol y relax.  Localizada frente a complejos hoteleros de primer orden, esta playa se ha consolidado como una de las más importantes del municipio.  Bordeada por el paseo marítimo, dispone de todo tipo de servicios y comodidades para los turistas. En las cercanías se encuentra una agradable terraza donde se puede disfrutar relajadamente de cualquier aperitivo junto al mar. Por las inmediaciones del paseo marítimo se puede contemplar una panorámica inmejorable de la vecina isla de La Gomera. Longitud: 350 metros. Anchura: 40 metros. Grado de ocupación: Alto Ubicación física: En el centro de Playa de Las Américas, frente al paseo marítimo y complejos hoteleros de exclusividad.  Accesos a la playa: para peatones. Parking cercanos para vehículos. Proximidad al núcleo turístico: Sí. Tipo de playa: Artificial Condiciones de baño: Aguas tranquilas Morfología: Arena   Servicios prestados:   -Alquiler de Hamacas y sombrillas -Duchas / Lavapiés -Papeleras -Baños -Servicio de limpieza -Actividades acuáticas (Jetsky, motos acuáticas,  parascending, pedales, banana) -    Seguridad policial  Datos históricos:    De sus llanuras se extrajo la arena y el callao con que fabricar viviendas, acequias, charcas, etc., y de su litoral la piedra caliza que después se transformaría en cal en los hornos de la zona. En la Punta de El Camisón, a los pies de El Cabezo Grande existieron unas salinas hasta mediados de los años 80: las Salinas de El Gincho. Importante entorno donde recababan, para descansar, muchas aves migratorias y de las que se abastecían los pescadores para el salado y jareado del pescado. En este paraje, casi desértico, se llegó a plantar cereales, tomates y algodón y existieron salones para guardar las herramientas y la sal que se extraía de las salinas, y dos hornos de cal. Esta zona reunía las condiciones perfectas, según numerosas autoridades e instituciones, para la construcción del aeropuerto de Tenerife, pero, lo lejos que estaba Los Cristianos de la capital, la falta de carretera en condiciones y otras carencias hicieron que se frustrara el proyecto.   Oficina de Información Turística más cercana:  Oficina de Información Turística Playa de Las Américas Tel: 922 797 668  Oficina de Información Turística Playa de Las Vistas Tel: 922 787 011 ', 'Playa del Camisón. Playa de Las Américas', '350 metros', 28.0639, -16.7306, );
INSERT INTO `playas` (`idPlaya`, `idMun`, `nombre`, `descripcion`, `direccion`, `playaSize`, `longitud`, `latitud`, `imagen`) VALUES
(1181, 4, 'Playa Las Americas', 'En un enclave natural incomparable Arona brinda una amplia gama de playas para la práctica de surf, donde expertos y principiantes podrán descubrir la particularidad de este deporte. Más de un kilómetro y medio de playas para  surfear se despliegan ante el visitante, sin duda un espectáculo durante todo el año.    En estas playas deportivas el amante del surf encontrará distintos tipo de olas, aptas para todos. Escuelas especializadas en este deporte brindan clases para distintos niveles, así como alquiler de equipos y tablas.    Durante años consecutivos se han realizado campeonatos de renombre en las playas para la práctica de surf que Arona oferta en este litoral de Playa de Las Américas, siendo este lugar el más óptimo para surfear en el sur de la isla de Tenerife.                  Es usual que los asiduos a este deporte se desplacen hasta este punto de la isla para la práctica de surf en busca del tipo de olas que el  municipio de Arona ofrece. Para muchos, es idílico poder zambullirse sobre la tabla bajo el sol de invierno que caracteriza este municipio.    Con la isla de la Gomera como telón de fondo, un paseo por esta zona del litoral puede resultar realmente placentero. Desde este lugar, donde existen terrazas  ‘chill out’ pensadas para el disfrute del buen tiempo todo el año, se pueden admirar los mejores atardeceres del sur de Tenerife.     Divagando entre las esculturas ubicadas en esta zona del paseo marítimo, el visitante encontrará un rincón  de la isla, donde el Atlántico, olas e incomparables atardeceres, convierten este lugar en un paraje singular en el municipio de Arona Longitud: 1,6 Kilómetros de extensión Grado de Ocupación: Medio Ubicación Física: Playa de Las Américas Proximidad al núcleo turístico: Sí Accesos a la playa: para peatones y vehículos. Parking Público en las cercanías. Tipo de playa: Natural Condiciones de baño: Oleaje fuerte Morfología: Rocas   Servicios Prestados:  -Papeleras -Seguridad Policial -Servicio de Limpieza   Olas y Picos en las Playas Deportivas:  Playa Honda: ‘Las Palmeras’, ‘La Izquierda’ ‘El Medio’ La Montañeta ‘El Conquistador’ o ‘La Derecha’ El Guincho: ‘La Piscina’ El Dedo El Cabezo Grande: ‘Salinas’ Charco del Marqués: ‘Fitenia’     El litoral costero de Playa de Las Américas es perfecto para los amantes de surf y bodyboard. Aquí se encuentran picos bien definidos en la zona de Palmeras, El Medio, Playa Honda, La Derecha, El Conquistador, La Piscina, El Dedo y Fitenia.    Todas presentan unas condiciones perfectas lo cual permite la práctica de este deporte tanto para principiantes como deportistas con un nivel más avanzado.    Las olas de este enclave se caracterizan por ser de ‘reef’ rocoso (comúnmente denominadas como bajas). Esto hace que se pueda formar una ola con características únicas, formando una ola con largo recorrido e incluso tubos. Éstas son muy valoradas por surfistas, pues nada tienen que envidiar a las de otros lugares del mundo.     En los años 90 la ola de ‘Palmeras’ quedó entre las diez mejores olas de Europa, dándole un merecido reconocimiento a nivel nacional e internacional, sumado a la sucesión de múltiples campeonatos de Surf de distintas categorías llevados a cabo en este lugar.    Las condiciones en invierno son de olas perfectas que rondan el metro de altura constante, con fuerza noroeste, llegando a rachas de temporal superando los dos metros de altura.     En Playa de Las Américas se puede presumir de un clima perfecto en nuestras playas, con temperaturas agradables durante todo el año. No en vano la temperatura del agua ronda los 19º. Un lujo que permite a los amantes de este deporte surfear con una licra de neopreno o para los más frioleros un 3/2 mm de traje de neopreno. Todo ello permite el baño prolongado durante más de dos horas sin sentir frío, considerándose impensable en Europa durante los meses de invierno.     En verano en las playas se disfruta del sol estival, con un mínimo de medio metro de olas ‘glassi’, con fuerza sur constante. No se requiere traje de neopreno, pues la temperatura del agua supera los 20º.    Las escuelas para la práctica de surf ofrecen clases de iniciación para el disfrute de las olas de Playa de Las Américas. En una sucesión de más de 1.5 kilómetros de costa encontrarás  olas consideradas de las mejores del mundo. Oficina de Información Turística más cercana:  Oficina de Información Turística Playa de Las Américas Tel: 922 797 668 ', 'Playa de Las Américas', '1,6 Kilómetros de extensión', 28.0639, -16.7306, );
INSERT INTO `playas` (`idPlaya`, `idMun`, `nombre`, `descripcion`, `direccion`, `playaSize`, `longitud`, `latitud`, `imagen`) VALUES
(1182, 4, 'Playa de Las Vistas', 'Sin duda alguna la más extensa del municipio de Arona, la Playa de Las Vistas se prolonga a lo largo de casi 1 kilómetro de longitud como nexo entre Playa de Las Américas y Los Cristianos.  Considerada como uno de los puntos de interés de la isla de Tenerife, esta playa se caracteriza por su variedad, animación y accesibilidad para todo tipo de bañistas.    La Playa de las Vistas se despliega ante el visitante, teniendo cabida para el relax, un clima incomparable,  actividades acuáticas de distinta índole, así como un baño en aguas limpias y tranquilas.    No en vano, se considera una playa para todos, donde turistas y residentes disfrutan del sol y el mar durante las cuatro estaciones.  Jóvenes y mayores, familias y parejas, encontrarán en la Playa de Las Vistas la playa perfecta para sus vacaciones.      Considerada como una de las de mayor renombre de Tenerife no sólo por sus características, sino por ser pionera en accesibilidad en Canarias, la Playa de las Vistas es una de las dos playas más visitadas de España por personas con movilidad reducida y ha sido galardonada con la distinción temática “Accesibilidad en Playas”.    Esta playa totalmente accesible es un lugar ideal para turistas con movilidad reducida gracias a sus  instalaciones sin barreras, todo tipo de servicios adaptados y la tranquilidad de sus aguas. Todo ello vinculado al excelente clima del municipio a lo largo de todo el año.     Longitud: 925 metros Anchura: 80 metros. Grado de ocupación: alto. Ubicación Física: Paseo Marítimo Playa de Las Vistas. Limita con Playa de Las Américas por el paseo marítimo. Cercana a la Estación Marítima de Los Cristianos. Proximidad al núcleo turístico: Sí Accesos a la playa: para peatones. Aparcamiento gratuito. Parking privados en las inmediaciones. Localización acceso para vehículos de emergencias: Sí. Tipo de playa: artificial Condiciones de baño: aguas tranquilas Morfología: arena  Servicios prestados:  -Alquiler de hamacas y sombrillas -Pasarelas -Duchas / Lavapiés -Papeleras -Baños -Servicio de limpieza -Contenedores para reciclaje de residuos -Socorrismo, vigilancia y equipos de salvamento - Área accesible para turistas con movilidad reducida. -Actividades acuáticas (Jetsky, motos acuáticas, parascending,  pedales, banana) -Seguridad Policial  -Webcam de la Playa de Las Vistas  en www.arona.travel   Área accesible en la Playa de Las Vistas:  Arona es uno de los destinos vacacionales con mayor número de turistas con movilidad reducida del mundo. La Playa de Las Vistas ofrece al visitante un área accesible donde podrá disfrutar de los siguientes servicios:   - Estacionamiento próximo a la playa con plazas reservadas. -Señalización de itinerario accesible, playa accesible y servicios. -Itinerario Accesible. -Rampas de acceso –6%. -Sillas anfibias -Muletas anfibias -Grúa hidráulica  -Pasarelas fijas de madera -Pasarelas enrollables -Zona de descanso con sombrillas -Área de vigilancia -Aseos adaptados -Duchas adaptadas    Playa de Las Vistas, fruto de las recientes obras de remodelación y ampliación tomó su nombre de la pequeña playa más próxima a San Telmo y que los vecinos llamaban “Vistas del Camisón”, uniéndose a la “Playa de la Carnada” situada delante de Vintersol  Oficina de Información Turística más cercana:  Oficina de Información Turística Playa de Las Vistas Tel: 922 787 011 ', 'Playa de Las Vistas. Los Cristianos', '925 metros', 28.05, -16.7172, );
INSERT INTO `playas` (`idPlaya`, `idMun`, `nombre`, `descripcion`, `direccion`, `playaSize`, `longitud`, `latitud`, `imagen`) VALUES
(1183, 4, 'Playa de los Cristianos ', '   La Playa de los Cristianos se considera una de las playas históricas del municipio de Arona. Ubicada en pleno centro neurálgico de Los Cristianos conserva aún la esencia del que antaño fue un pequeño poblado marinero, dando  paso posteriormente a uno de los núcleos turísticos más conocidos de Tenerife. Distintas embarcaciones pesqueras hacen hoy en día que permanezca la esencia del pueblo de pescadores que aún en la actualidad se funde con el enclave turístico de Los Cristianos, lo que le confiere cierta particularidad donde se mezclan pasado y presente.  Longitud: 400 metros Anchura: 82 metros Grado de ocupación: Alto Ubicación Física: Junto a la zona peatonal comercial de Los Cristianos, frente al paseo marítimo. En las cercanías de la explanada de la estación marítima. Proximidad al núcleo turístico: Sí Accesos a la playa: para peatones. Parking privado para vehículos en las inmediaciones. Tipo de playa: Natural Condiciones de baño: aguas tranquilas Morfología: Arena.    Servicios prestados:  -Alquiler de hamacas y sombrillas -Duchas / Lavapiés -Papeleras -Baños -Servicio de limpieza -Contenedores para reciclaje de residuos -Socorrismo, vigilancia y equipos de salvamento -Escuela de Vela Datos históricos:     La Playa de Los Cristianos está en gran manera unida al comienzo del turismo en el sur de Tenerife. En el año 1957 un grupo de jóvenes suecos con movilidad reducida, originada por problemas reumáticos, llegó al poblado marinero de Los Cristianos después de haber recorrido medio mundo. En este lugar, gracias a su agradable clima y a su playa, mejoró notablemente su estado de salud. La llegada de estos visitantes escandinavos dio lugar al nacimiento del turismo en el municipio de Arona. Desde entonces hasta la actualidad, Los Cristianos se ha convertido en un reclamo turístico para visitantes de distintas nacionalidades a lo largo del año. Gracias a su clima benéfico y las óptimas condiciones de su costa, miles de turistas  buscan en Playa de Los Cristianos y Playa de Las Américas el sol de invierno tan anhelado en sus países en los meses de frío. Oficina de Información Turística más cercana:  Oficina de Información Turística Playa de Las Vistas Tel: 922 787 011 ', 'Playa de Los Cristianos', '400 metros', 28.05, -16.7172, NULL),
(1184, 4, 'Playa del Callao ', '   La Playa del Callao ofrece al bañista tranquilidad y relax. En un enclave sin aglomeraciones el visitante podrá disfrutar del mar en su estado más puro. En esta playa, alejada del bullicio, el turista encontrará un paraje en el que el Espacio Natural Protegido de Guaza tiene sus faldas.     Una de las principales características de la Playa del Callao es que dispone de un área nudista. La combinación de arena y piedras le confieren un aspecto natural, y sus aguas limpias a mar abierto hacen de la Playa del Callao un espacio donde el disfrute del sol y el mar está garantizado. Longitud: 420 m. Anchura: 30 m.  Grado de ocupación: bajo Ubicación física: Final de la Avenida Juan Carlos I, dejando atrás el paseo marítimo. Proximidad al núcleo turístico: Semiurbana. Accesos a la playa: Para peatones. Aparcamiento público en los alrededores. Tipo de Playa: Natural Vegetación: Sí Condiciones de Baño: Aguas tranquilas Morfología: ‘Callaos’ (Piedras redondas semiplanas) Zona nudista: Si Servicios prestados:   -Papeleras -Seguridad policial -Servicio de limpieza  Esta playa está tradicionalmente vinculada a la pesca y el marisqueo de burgados y lapas  ', 'Playa del Callao. Playa de Los Cristianos', '420 m', 28.0396, -16.7085, NULL),
(1185, 4, 'Playa de Las Galletas', ' A 15 km de los núcleos turísticos de Playa de Las Américas y Los Cristianos se encuentra el enclave costero de Las Galletas. Su costa, abastecimiento de pescadores ayer y hoy, es transitada por gente del lugar convirtiendo la Playa de Las Galletas en una de las de mayor ambiente local del municipio de Arona.     El mercado de pescado, y la Marina del Sur, le confieren un peculiar aspecto marinero. Es  frecuente encontrar pescadores realizando su actividad diaria, tejiendo redes o habilitando sus barcas para el ejercicio cotidiano de la pesca.     Sin duda alguna la Playa de Las Galletas muestra al visitante un claro ejemplo del más puro ambiente local, donde el turismo se mezcla con los lugareños durante todo el año. Longitud: 420 metros Anchura: 25 metros Grado de ocupación: medio Zona de fondeo: dispone de pantalanes y zona de fondeo para barcos. Ubicación física: En una de las principales vías de entrada al núcleo costero de Las Galletas. Proximidad al núcleo turístico: Sí. Accesos a la playa: para peatones. Aparcamiento público en las inmediaciones. Tipo de playa: natural Condiciones de baño: Aguas tranquilas Morfología: Playa mixta de grava y arena.   Servicios prestados:  -Alquiler de hamacas -Lavapiés -Papeleras -Baños -Servicio de limpieza -Torre de vigilancia -Webcam de la Playa de Las Galletas  en www.arona.travel  Datos históricos:   Las Galletas nace como núcleo vinculado a la pesca y al marisqueo en sus bellos  bahíos. La Playa de Las Galletas es aquella en la que los pescadores varaban sus barcos y sobre los negros ‘callaos’, sus mujeres clasificaban el pescado, dispuestos en cajas o cestas  para su venta.    En la orilla de la Playa de Las Galletas se levantaba “El Salón”, hoy desaparecido pero aún presente en la memoria de sus vecinos. El Salón, era una construcción de principios del siglo XX, y está relacionado al cultivo del tomate. En el Salón se almacenaban los tomates a la espera de ser trasladados en barcos de cabotaje a Santa Cruz, capital de la isla,  para su posterior exportación.  Oficina de Información Turística más cercana:  Oficina de Información Turística Playa de Las Galletas Tel: 922 730 133 ', 'Playa de Las Galletas', '420 metros', 28.0087, -16.6599, NULL),
(1186, 4, 'Playa Charco del baño ', 'Esta pequeña playa se encuentra a continuación de la Playa de Las Galletas, separadas por el muelle embarcadero de esta localidad.     Charco del baño se caracteriza por ser una playa con carácter acogedor, frecuentada mayormente por lugareños, donde se respira aún el olor a sal y tiempos pasados. El  descanso está garantizado en este pequeño enclave bordeado por un pequeño paseo marítimo donde variedad de restaurantes ofrecen productos de la tierra y el mar. Terrazas para el disfrute del buen tiempo y la comodidad se encuentran en primera línea de esta singular playa.   Longitud: 240 metros Anchura: 16 metros Grado de ocupación: Bajo Ubicación física: en el paseo marítimo de Las Galletas. Junto al muelle y la rambla. Proximidad al núcleo turístico: Sí Accesos a la playa: para peatones. Aparcamiento público en vías de acceso al pueblo. Tipo de playa: Natural Condiciones de baño: Oleaje moderado Morfología: Mixta (Arena y rocas)    Servicios Prestados:  Alquiler de hamacas Duchas Papeleras Baños Servicio de limpieza Rampas de acceso  Datos Históricos:  El Charco del Baño ha acogido tradicionalmente el trasiego de vecinos y visitantes. La vinculación de los pescadores del lugar y sus familias con sus bahíos es intensa pues de ellos obtienen  sustento y como no, momentos  de ocio.    Oficina de Información Turística más cercana:  Oficina de Información Turística Playa de Las Galletas Tel: 922 730 133 ', 'Playa de Las Galletas', '240 metros', 28.0087, -16.6599, NULL),
(1187, 5, 'Playa Jardín de Punta Brava', 'Este maravilloso espacio costero, fruto de una obra pública de reacondicionamiento del litoral, terminada en 1993, comienza a la altura del Castillo San Felipe y enlaza con el barrio de Punta Brava. Es un conjunto de playas de arena negra volcánica cuyo entorno de espléndidos jardines y paseos peatonales fue diseñado por el artista Cesar Manrique. A lo largo de un frente costeros de 600 metros de longitud se distribuye una completa red de instalaciones de servicios y esparcimiento, ambientada con una rica vegetación, cascadas de agua marina y cuevas de piedra artificial que embellecen los alrededores y hacen honor a su nombre. La calidad de estas instalaciones y su cuidada estética natural hacen de Playa Jardín un lugar de singular belleza y confortabilidad, reconocido con la Bandera Azul de la Unión Europea. La construcción de Playa Jardín costó al Ministerio de Obras Públicas casí 2.000 millones de pesetas. Las obras, dirigidas por el artista César Manrique y los ingenieros Amigó y Olcina, fueron realizadas por las empresas Cubiertas y MZOV y Ferrovial. Para la enarenación de la antigua playa de callaos, se utilizaron 23.000 metros cúbicos de arena volcánica extraída de fondos marinos cercanos. En la construcción de la escollera semisumergida que protege la playa del fuerte oleaje predominante en la costa norteña, se emplearon 4.226 bloques de hormigón de 20 toneladas, equivalentes a 35.207 metros cúbicos de hormigón.', 'Avenida Francisco Afonso Carrillo, Puerto de la Cruz', '700 metros', 28.4111, -16.5608, NULL),
(1188, 6, 'Playa de Playa San Juan', 'Sin descripción', 'Playa San Juan', 'Desconocido', 28.1813, -16.8176, NULL),
(1189, 6, 'Playa Abama', 'Sin descripción', 'Crta. General Tf 47, Playa San Juan (Hotel Abama)', 'Desconocido', 28.171, -16.7968, NULL),
(1190, 6, 'Playa de Alcalá', 'Sin descripción', 'Alcalá', 'Desconocido', 28.2027, -16.8283, NULL),
(1191, 7, 'Playa de las Teresitas', 'Situada en el pueblo de San Andrés. Hasta su transformación estaba dividida en tres partes bien diferenciadas que poseían nombres distintos: Tras la Arena que era la parte inicial, Los Moros, en el medio y por último la zona comprendida por el barranco de Las Teresas. Sobre la playa de arena negra, se echó arena blanca traída del desierto del Sáhara, y se construyó un dique rompeolas para evitar el oleaje.', 'San Andrés', '1.300 metros', 28.5085, -16.1872, NULL),
(1192, 4, 'Costa del Silencio', 'A escasos kilómetros de Las Galletas se encuentra el núcleo turístico de Costa del Silencio, lugar donde se construyeron los primeros asentamientos turísticos del sur de la isla.  Tal y como su nombre indica, Costa del Silencio nos muestra una naturaleza costera distinta al resto del litoral del municipio de Arona. La orografía volcánica de la isla de Tenerife, ha conferido a este lugar una sucesión de pequeñas calas y enclaves aptos para el baño. Existe en este lugar un pequeño paseo que recorre el litoral, desde el que se disponen varios accesos para disfrutar de un baño en mar abierto. Haciendo honor a su nombre, esta es una de las zonas de baño más apacibles del municipio de Arona, aunque mayormente aptas para adultos dada la escasez de arena y zonas de descanso. El litoral de Costa del Silencio ofrece a sus visitantes la quietud y transparencia del Atlántico, sin duda alguna, un baño relajante en aguas cristalinas. CARACTERÍSTICAS  Grado de ocupación: Bajo. Ubicación física: Costa del Silencio. Descendiendo escaleras del pequeño paseo. Proximidad al núcleo turístico: Sí. Accesos a la playa Para peatones. Tipo de playa: Mar abierto. Condiciones de baño: Aguas tranquilas. Morfología: Fondo rocoso, gran profundidad.  SERVICIOS PRESTADOS • Solarium • Escaleras de acceso a solarium • Escaleras de acceso al mar  OFICINA DE INFORMACIÓN TURÍSTICAMÁS CERCANA Oficina de Información Turística Playa de Las Galletas Tel: 922 730 133 ', 'Costa del Silencio', 'Desconocido', 28.0074, -16.6451, NULL),
(1193, 4, 'Piscina Marina el Castillo ', 'Este complejo con bandera azul ,tiene dos piscinas largas de agua de mar, una para niños y una pequeña playa, Playa de San Juan. de arena protegida por un rompeolas . Servicios que se ofrecen: -Socorrismo y primeros auxilios -Accesos fáciles y seguros - Análisis y Limpieza del agua -Mantenimiento y limpieza -Baños y baños para discapacitados -Duchas y vestuarios -Contenedores de reciclaje  -Bar restaurante -Silla anfibias para discapacitados -zona de aparatos deportivos  -zona de juego para niños -zona de descanso para discapacitados -parking para discapacitados ', 'Bajamar ', 'Desconocido', 28.5556, -16.345, NULL),
(1194, 4, 'Piscina Marina El Arenisco', 'Fue la Primera Piscina Natural en Europa en poseer la Bandera Azul. Fue otorgado en reconocimiento  al cuidado del medio ambiente , enfatizando en : La calidad del agua de baño, la accesibilidad y seguridad, los servicios y facilidades ,además de la información y las actividades educativas en el entorno', 'Punta del Hidalgo ', 'Desconocido', 28.569, -16.3245, NULL),
(1195, 4, 'Piscina Natural Jover', 'Es una pequeña piscina de agua del mar con una atmósfera familiar y magnificas vistas  de los acantilados de la costa de La Laguna Servicios que ofrece: -Socorrismo y primeros auxilios -analisis y limpieza del agua -Mantenimiento y limpieza -Contenedores de reciclaje -Bar y restaurantes -Baños y baños equipados para discapacitados durante la temporada de baño', 'Jover', 'Desconocido', 28.5478, -16.3697, NULL),
(1196, 4, 'Playa de El Cangrejillo', 'En una de las pequeñas bahías que conforman el dibujo del litoral sauzalero, encontramos “El Cangrejillo”, ideal para el baño, la práctica de deportes acuáticos o simplemente para disfrutar alguna de las más hermosas puestas de sol que ofrece el norte de Tenerife.', '', 'Desconocido', 0, 0, NULL),
(1197, 4, 'Playa de Rojas', 'Sin descripción', '', 'Desconocido', 0, 0, NULL),
(1198, 4, 'Piscinas naturales Caletón (del)', ' Fruto de la erupción volcánica de 1.706, cuyas lavas sepultaron para siempre el viejo puerto se formó de manera caprichosa el brazo del mar conocido como El Caletón, con sus distintos “charcos”( Las Viejas, Los Niños, Los Chorros,…) que constituyen un conjunto de piscinas naturales, con aceptables condiciones para el baño y un excelente paseo marítimo.', 'Avda. Tome Cano.', 'Desconocido', 28.3731, -16.7652, NULL);

